import React from 'react';
import Logo from '../../Assets/NextYa.png'

export default ()=>{
    return(
        <header className="header">
            <div className="header--logo">
                <a href="/">
                    <img src={Logo} alt="logo" />
                </a>
            </div>

            <div className="header--btnCadastro">
                <a href="">Cadastro</a>
            </div>

        </header>
    )
}
